    </body>
    </html>
},)

    return(
        <>
            <button onClick={()=>{
                SetNum(num +1)
            }}>Click Me {num}</button>
            <br />
             <button onClick={()=>{
                SetNums(nums +1)
            }}>Click Me {nums +1}</button>
        </>
    )
}

export default Effect;
